import React from 'react';
import Head from 'next/head';
import AppLayout from '../components/AppLayout';
import { Form, Input, Checkbox, Button } from 'antd';

const Signup = () => {
    const term = '';
    const onSubmit = () =>{

    };

    const onChangeId = () => {

    };

    const onChangeNick = () => {

    };

    const onChangePass = () => {

    };

    const onChangePassChk = () => {

    };

    const onChangeTerm = () => {

    };

    return (
        <>
            <Head>
                <title>NodeBird</title>
                <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/antd/3.16.2/antd.css" />
            </Head>
            <AppLayout>
                <Form onSubmit={onSubmit} style={{ padding: 10 }}>
                    <div>
                        <label htmlFor="user-id">아이디</label>
                        <br />
                        <Input name="user-id" required onChange={onChangeId} />
                    </div>
                    <div>
                        <label htmlFor="user-nick">닉네임</label>
                        <br />
                        <Input name="user-nick" required onChange={onChangeNick} />
                    </div>
                    <div>
                        <label htmlFor="user-pass">비밀번호</label>
                        <br />
                        <Input name="user-pass" type="password" required onChange={onChangePass} />
                    </div>
                    <div>
                        <label htmlFor="user-pass-chk">비밀번호 확인</label>
                        <br />
                        <Input name="user-pass-chk" type="password" required onChange={onChangePassChk} />
                    </div>
                    <div>
                        <Checkbox name="user-term" value={term} onChange={onChangeTerm}>
                            OOO 약관에 동의합니다.
                        </Checkbox>
                    </div>
                    <div>
                        <Button type="primary" htmlType="submit">가입하기</Button>
                    </div>
                </Form>
            </AppLayout>
        </>
    );
};

export default Signup;
